package components.caret;

import java.util.Vector;
import javax.swing.text.JTextComponent;

import bus.uigen.OEFrame;
import bus.uigen.uiFrame;
import bus.uigen.oadapters.ClassAdapter;
import bus.uigen.oadapters.ObjectAdapter;
import components.mathEditor.MathEditorPanel;

public class CaretManager {
	private ObjectAdapter observablePropertyAdapter;
	private Vector<ObjectAdapter> children;
	private CaretActionListener listener;
	private MathEditorPanel panel;
	
	public CaretManager(OEFrame newFrame, MathEditorPanel aPanel) {
		ClassAdapter adapter = (ClassAdapter) ((uiFrame) newFrame).getTopAdapter();
		children = adapter.getChildrenVector();
		panel = aPanel;
	}
	
	public void addCaretActionListener(String observablePropertyName) {
		for (ObjectAdapter child : children) {
			if (child.getComponentName().equals(observablePropertyName)) {
				observablePropertyAdapter = child;
			}
			break;
		}
		if (observablePropertyAdapter == null) {
			System.err.println("Observable Property not found");
			return;
		}
		if (!(observablePropertyAdapter.getUIComponent().getPhysicalComponent() instanceof JTextComponent)) {
			System.err.println("Observable Component has no caret");
			return;
		}
		
		listener = new CaretActionListener(panel);
		((JTextComponent) observablePropertyAdapter.getUIComponent().getPhysicalComponent()).addCaretListener(listener);
		
	}
	
	public void removeCaretActionListener() {
		((JTextComponent) observablePropertyAdapter.getUIComponent().getPhysicalComponent()).removeCaretListener(listener);
	}
	
	
	
}

